import { Button } from 'antd'
import Link from 'next/link'
import Router from 'next/router'

export default () => {

  function gotoB() {
    Router.push('/test/b')
  }
  return (
    <>
      <Link href="/a">
        <Button>Index</Button>
      </Link>
      <Button onClick="gotoB">test b</Button>
    </>
  )
}
